import Subject from "./Subject";
import Table from "./Table";

const Timetable = () => {
const subjects = ['Artificial Inteeligence', 'Internet Programming', 'FullStackTechnologies', 'Computer Architecture', 'Computer Nentworks', 'User Experience Design', 'FST Lab', 'IP Lab', 'CN Lab'];

return (
<div className="design">
...
<div className="sub">
<Subject subject={subjects} />
</div>
<div className="staffWrapper">
<div className="staffsss">
<StaffList staff={name} />
</div>
<div>
<Table />
</div>
</div>
</div>
);
};

export default Timetable;
